  http://www.511mn.org/rnrnNote: This is an Esri Feature Collection which is different
  than an Esri Feature Service. Feature Collections allow for high-availability. There
  are unique characteristics that need to be considered when using this data type:
  rnrn- It is a file-based data type so there is no REST endpoint. However, there
  is JSON that can be parsed out. See link at the bottom of this page.rnrn- You cannot
